import react from 'react'
import { useState } from 'react'
import {redirect} from 'react-router-dom'
import TextField from '@mui/material/TextField'
import '../css/Auth.css'
import { DomainURL } from '../constants'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'

function Login(){
  const [isCorrectPass, setIsCorrectPass]=useState(true)
  const Navigate=useNavigate()
  const handelSubmit =async (e)=>{
    e.preventDefault()
    let userId = e.target.form[0].value
    let password = e.target.form[1].value
     const loginRes = {}//await axios.post(`${DomainURL}/auth/login`,{
    //   data:{
    //     email:userId,
    //     password:password
    //   }
    // })
    console.log(loginRes)
    if(1){//loginRes?.data?.status == 200){
      setIsCorrectPass(false)
      return(
        <redirect to ="/"/>
      )
    }
    else{
      
      setIsCorrectPass(false)
    }
   
  }

 

  const handleSignup = () => {
    console.log('Signup button clicked');
    Navigate('/signup')
  };


  return (
    <div>
      <form className='login-container'>
        <h2>Login</h2>
        {isCorrectPass?<div></div>:
        <div>Invalid UserName/Password</div>}
        <div className='form-grp'>
        <label htmlFor='loginId' >UserName/Email</label>
        <input type='text' name='loginId' required ></input>
        </div>
        <div className='form-grp'>
        <label htmlFor="password">Password</label>
        <input type='password' name='password' required></input>
        </div>
        <div className='buttons'>
        <button type='submit' onClick={handelSubmit}>Login</button>
        <button className='signup' type="button" onClick={handleSignup} >Signup</button>
        </div>
      </form>
      
    </div>
  )
}

function Register(){
  const handelSubmit=async (e)=>{
    e.preventDefault()
    const name = e.target.form[0].value
    const username = e.target.form[1].value
    const email = e.target.form[2].value
    const phone = e.target.form[3].value
    const password = e.target.form[4].value
console.log(name,username,email,phone,password)
const registerRes = await axios.post(`${DomainURL}/auth/register`,{
  data:{
    name,
    username,
    email,
    phone,
    password,

  }
  
})
console.log(registerRes)
    
  }

  return (
    <div>
      <form className='login-container'>
        <div className='form-grp'>
          <label htmlFor='name'>Name</label>
          <input type='text' name='name' required></input>
        </div>
        <div className='form-grp'>
          <label htmlFor='username'>Username</label>
          <input type='text' name='username' required></input>
        </div>
        <div className='form-grp'>
          <label htmlFor='email'>Email</label>
          <input type='text' name='email' required></input>
        </div>
        <div className='form-grp'>
          <label htmlFor='phone'>Phone</label>
          <input type='text' name='phone' required></input>
        </div>
        <div className='form-grp'>
          <label htmlFor='password'>Password</label>
          <input type='password' name='password' required></input>
        </div>
        <div className='buttons'>
        <button type='submit' onClick={handelSubmit}>Register</button>
        </div>
      </form>
    </div>
  )
}

function Logout(){
const handelLogout=async(e)=>{
  e.preventDefault()
  const res = await axios.post(`${DomainURL}/auth/logout`)
  console.log(res)
}
  return(
    <div>
      <button onClick={handelLogout}>Logout</button>
    </div>
  )
}

export {Login, Register,Logout}
